import styled from "styled-components";
import IconContext from "react-icons";

function MenuIcon() {
  return (
    <IconWrapper>
      <IconName></IconName>
    </IconWrapper>
  );
}

const outlineIconNames = {
  homeOutline: "HiOutlineHome",
  filmOutline: "RiMovie2Line",
  bookOutline: "HiOutlineBookOpen",
  tvOutline: "IoTvOutline",
  more: "TfiMenuAlt",
};

const iconNames = [
  { icon1: "HiOutlineHome", icon2: "HiHome" },
  { icon1: "RiMovie2Line", icon2: "RiMovie2Fill" },
  { icon1: "HiOutlineBookOpen", icon2: "BsFillTvFill" },
  { icon1: "IoTvOutline", icon2: "HiBookOpen" },
  { icon1: "TfiMenuAlt", icon2: "TfiMenuAlt" },
];

const fullIconNames = {
  homeFull: "HiHome",
  filmFull: "RiMovie2Fill",
  tvFull: "BsFillTvFill",
  bookFull: "HiBookOpen",
  more: "TfiMenuAlt",
};

export default function BottomNavigationMenu() {
  return (
    <MenuWrapper>
      <>Menu</>
    </MenuWrapper>
  );
}

const MenuWrapper = styled.div`
  position: fixed;
  bottom: 0;
  left: 0;
  display: flex;
  height: 100px;
  width: 100vw;
  background-color: magenta;
  align-items: center;
  justify-content: space-around;
`;

const IconWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: auto;
  height: 60px;
`;

const IconName = styled.h1`
  font-size: 20px;
`;
